    import './App.css';
    import Header from './components/Header';
    import Post from './components/Post';

    class App extends Component {
      render() {
        return <div className="App">
            <Header />
            <section className="App-main">
              <Post nickname="Justelis" avatar="https://www.laravelnigeria.com/img/chris.jpg" caption="Yra lopas" image="https://static.wixstatic.com/media/262881_323b1bf2ea9d452bbad6afe7d7baba97~mv2.jpg/v1/fill/w_600,h_600,al_c,q_80,usm_0.66_1.00_0.01/1.webp" />
              <Post nickname="OG" avatar="https://www.laravelnigeria.com/img/chris.jpg" caption="Holding a mic" image="https://static.wixstatic.com/media/262881_f1c8714f18c64ac3a8590b12abe561d9~mv2.jpg/v1/fill/w_600,h_600,al_c,q_80,usm_0.66_1.00_0.01/2.webp" />

            </section>
          </div>;
      }
    }

    export default App;
